import React from 'react';
import { Link } from 'react-router-dom';

function HomePage() {
  return (
    <div style={{ textAlign: 'center', marginTop: '80px' }}>
      <h1>Leave Management System</h1>
      <p>Please select your login type:</p>
      <div>
        <Link to="/admin-login">
          <button style={{ margin: '10px', padding: '10px 20px' }}>Admin Login</button>
        </Link>
        <Link to="/user-login">
          <button style={{ margin: '10px', padding: '10px 20px' }}>User Login</button>
        </Link>
      </div>
    </div>
  );
}

export default HomePage;
